import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import logo from "../resources/logo.svg";

function Navbar() {
	return (
		<Wrapper>
      <div className="navbar-left_bar">
        <div className="navbar-logo">
	        <img src={logo} alt="logo" />
        </div>

        <ul className="navbar_catalog">
          <li className="navbar_catalog-item">
		        <Link to="/" className="navbar_catalog-name">
              Главнвя
            </Link>
          </li>
          <li className="navbar_catalog-item">
		        <Link to="/catalog" className="navbar_catalog-name">
              Каталог
            </Link>
          </li>
          <li className="navbar_catalog-item">
		        <Link to="/blogs" className="navbar_catalog-name">
              Блог
            </Link>
          </li>
				</ul>
			</div>

			<div className='navbar-right_bar'>
        <select className="navbar-location">
	        Алматы
        </select>
        <select className="navbar-lang">
          <option language="russian" class="lang-item active">Рус</option>
          <option language="kazakh" class="lang-item">Қаз</option>
          <option language="english" class="lang-item">Eng</option>
        </select>
			</div>
		</Wrapper>
	);
}

const Wrapper = styled.nav`
	display: flex;
  justify-content: space-between;
	align-items: center;
	height: 5rem;
	background: var(--clr-white);
	z-index: 2;

	.navbar_catalog {
		display: flex;
    align-items: center;
	}

  .navbar-left_bar,
  .navbar-right_bar {
    display: flex;
  }
`;

export default Navbar;
